webpackJsonp([0x5b21eeda08d7],{1533:function(a,e){a.exports={data:{markdownRemark:{html:"<p>上海国際教育交流センターに行き、社会科学の初等部に参加してください。</p>\n<p>学術研究の成功、トピックの大部分、トピックの選択は前提条件です。他の人が一般的な問題を見ている場所で特別なトピックを見て、他の人が水平の問題を見る場所で垂直な問題を見て、他の人が垂直の問題を見る場所を見てください。これらは学習の成功の前提条件です。問題は、これを行うことは容易ではないということです。学問的に合理的に栽培されなければならず、問題を特別に把握しなければなりません。</p>\n<p>したがって、学術研究者は新しい分野、つまりクリエイターの先駆者でもあります。あなたが他人が開発した場所で働くだけであれば、明らかに大きな創造性はありません。全体の問題は、新世界を発見するのと同じように、新しい領域を発見することです。</p>\n<p>7時には、Huating Hotelを訪れ、国際シンポジウム「21世紀国際化のための国際シンポジウム」の歓迎レセプションに参加してください。</p>",id:"/home/swain/workspace/political-life/src/pages/ja/0181.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/ja/0181.md",frontmatter:{title:"11月10日 木曜日"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/ja/0181.md absPath of file >>> MarkdownRemark"}}}});
